import Table from "../../../../components/table/Table"


const DashboardTable = () => {
  const tableHeaders = [
    {
      name : 'Loan',
      orderable : true,
    },
    {
      name : 'Market size',
      orderable : true,
    },
    {
      name : 'APY',
      orderable : true,
    },
    {
      name : 'Total Available',
      orderable : true,
    },
    {
      name : 'Borrowed',
      orderable : true,
    },
  ]
  return (
    <>
      <Table
        tableHeaders={tableHeaders} 

      />
    </>
  )
}

export default DashboardTable
